import React from 'react';
import './style.css';

import { VictoryBar, VictoryChart, VictoryTheme, VictoryAxis, VictoryLabel } from 'victory';

const sampleData = [
  {x: "SQL", y: 2},
  {x: "C++", y: 3},
  {x: "JS", y: 3},
  {x: "Python", y: 4},
  {x: "Java", y: 5},
];

class Skills extends React.Component {
  render() {
    return <p>hi</p>;
    return (
      <div>

      <div className="chart-wrapper">
      <VictoryChart
        theme={VictoryTheme.material}
        animate={{
          duration: 2000,
          easing: "bounce"
        }}
        height={200}
        domainPadding={{ x: 10 }}
        >

        <VictoryLabel text="Programming Language Proficiency" x={225} y={30} textAnchor="middle"/>

        <VictoryAxis

        />
        <VictoryAxis
          dependentAxis
          tickFormat={[1,2,3,4,5]}
        />
        <VictoryBar horizontal
          data={sampleData}
          barRatio={0.8}
          labels={({ datum }) => datum.y}
          style={{ labels: { fill: "white" } }}
          labelComponent={<VictoryLabel dx={-20}/>}

        />
      </VictoryChart>
      </div>
      </div>
    )

  }
}

export default Skills;
